def reduce_polymer(polymer):
    polymer = _reduce_polymer(zip(polymer[0::2], polymer[1::2]))
    polymer = polymer[0] + _reduce_polymer(zip(polymer[1::2], polymer[2::2])) + polymer[-1]

    return polymer


def _reduce_polymer(pairs):
    return "".join(
        a + b
        for a, b in pairs
        if not is_reducable(a, b))


def total_reduce(polymer):
    previous = polymer
    polymer = reduce_polymer(polymer)
    while previous != polymer:
        previous = polymer
        polymer = reduce_polymer(polymer)

    return polymer


def is_reducable(a: str, b: str):
    if a.lower() == b.lower():
        if (a.islower() and b.isupper()) or (a.isupper() and b.islower()):
            return True

    return False


def improve_polymer(polymer, to_improve=None):
    if to_improve is None:
        shortest = polymer
        for unit in {*polymer.lower()}:
            improved = improve_polymer(polymer, to_improve=unit)
            if len(improved) < len(shortest):
                shortest = improved

        return shortest

    return total_reduce([c for c in polymer if c.lower() != to_improve])


if __name__ == "__main__":
    puzzle = ""
    print(f"part 1: {len(total_reduce(puzzle))}")
    print(f"part 2: {len(improve_polymer(puzzle))}")
